import styled from 'styled-components';
import './MainPage.css'
import { Link } from "react-router-dom";


const RootStyle  = styled.div`
  background:#DC143C;
  height:100vh;
`

const MainPage = () => {


  return(
    <RootStyle>
        <div class="main">   
          <h2 class="row1 center">Teknolojik Yemekler</h2>
          <h1 class="row2 center">KOD ACIKTIRIR <br/>
              PIZZA, DOYURUR
          </h1>
          <Link></Link> <button class="button center" onclick="/OrderPage" >ACIKTIM</button>
          <div class="img">
            <img src={require("../Assets/adv-aseets/adv-form-banner.png")}
            alt ="Ana Sayfa Pizza" style={{transform:'rotate(180deg)'}}/>
          </div>
        </div>
     </RootStyle>
  );
}

export default MainPage;
